import "./GroupComponent5.css";

const GroupComponent5 = () => {
  return (
    <div className="ellipse-wrapper">
      <img className="group-child4" alt="" src="../ellipse-12.svg" />
      <img className="group-child5" alt="" src="../ellipse-22.svg" />
      <img className="group-child6" alt="" src="../ellipse-33.svg" />
    </div>
  );
};

export default GroupComponent5;
